import React from 'react';
import css from '../styles/main.scss';
import Router from 'next/router';

const OutlineBtn = props => {
  return (
    <div
      onClick={() => Router.push(props.path ? props.path : '')}
      className={css.outlineBtn}
    >
      {props.name}
    </div>
  );
};

export default OutlineBtn;
